					if (!$referrerFK->isDeleted()) {
						$affectedRows += $referrerFK->save($con);
					}
				}
			}

			if ($this->collTbalunobackupsRelatedByCep !== null) {
				foreach ($this->collTbalunobackupsRelatedByCep as $referrerFK) {
					if (!$referrerFK->isDeleted()) {
